INSERT INTO `communities` VALUES (47,'Bailey Park of Brownsburg','community_images/1486135824_93xgwdayy2.jpeg','community_images/1490294696_0hw68rw3vs.jpeg','7774 Bedford Court',NULL,'Brownsburg','Indiana','46112','39.8514371','-86.3872654','3178523456','','','','baileypark@hi-mgmt.com','www.baileyparkbrownsburg.com/index.php',1,0,NULL,'',NULL,'',NULL,'',NULL,'wo1NRmuKjdpMrK2I09LN1QQDZu0ueviIHz11Rme5cMVbky7lZGG3mv9WCBhhfkeNfdt4Al','2017-02-03 10:30:25','2017-03-23 14:44:56'),(48,'Sunrise on Old Meridian','community_images/1486145474_6rn0c9qo2c.jpg','community_images/1490294697_n39trmqhqd.jpeg','12130 Old Meridian Street',NULL,'Carmel','Indiana','46032','39.9672453','-86.156652','3175690100','','','','Oldmeridian.dos3@sunriseseniorliving.com','sunriseonoldmeridian.com',1,0,NULL,'',NULL,'','Julie Kimmel','3175690100','julie.kimmell@sunriseseniorliving.com','kgp2NJb0hLhJ0yyecL0opfuhPpvlig9bNG6oORxP88bW0ozLbm2x4FEcLOuweML4WDPZg6','2017-02-03 13:11:14','2017-03-23 14:44:57'),(50,'The Barrington of Carmel','community_images/1487174096_wr17r4lg02.jpg','community_images/1490294698_vnc2clr4sf.jpeg','1335 S. Guilford Road',NULL,'Carmel','Indiana','46032','39.9596838','-86.1399004','3178101800','','','',NULL,'www.thebarringtonofcarmel.org/',0,0,'Janine Short','','JShort@thebarringtonofcarmel.com','','Emma Pennington','9134910600','epennington@glynndevins.com','jiOJ29rtRlIMj8WrF2hDVKmf5Bettmgec9wQb4v9T6Akok0Zr6q05MsESJT4XVNYG699ow','2017-02-15 10:54:57','2017-03-23 14:45:00'),(74,'Carmel Senior Living','community_images/1487429127_9FE2OHb8sD.jpg','community_images/1496860799_i1gh8wkpbb.jpeg','13390 North Illinois Street',NULL,'Carmel','Indiana','46032','39.984189','-86.148131','3179730307','','','','Info@carmelseniorliving.com','www.carmelseniorliving.com',1,1,NULL,'',NULL,'Welcome to Carmel Senior Living, a warm community in Carmel, Indiana. Here, you or your loved one can enjoy a full lifestyle that balances activity, independence and assistance. It includes upscale amenities, chef-prepared meals, concierge services, transportation and enriching activities—just north of Indianapolis in the quaint Carmel neighborhood.\r\n\r\nA truly all-inclusive senior living community, Carmel Senior Living offers five living options. Whether you need light care or more assistance, and a short-term stay or long-term home, you’ll find it here—for care that meets your needs today, and down the road.\r\n\r\nSituated on the west side of Carmel, just north of Indianapolis, Carmel Senior Living offers the best of both worlds. On one hand, you’ll love Carmel’s friendly shops and restaurants. On the other, you’re close to the many events and attractions of the capitol city and surrounding area.','Amy Anderson','3033608812','aanderson@spectrumretirement.com','f95J3vbXrdKLL6KUh1TbOvADkVSAHlwFplBV8JkKTzHXiEABqY5XV9o5JP1Cr6TFWB2pLJ','2017-02-18 08:57:55','2017-06-07 14:39:59'),(75,'Meadow Brook Senior Living','community_images/1487426672_3b4xbafkk6.jpg','community_images/1496860826_9eyq495ja0.jpeg','11011 Village Square Lane',NULL,'Fishers','Indiana','46038','39.9489649','-86.0416835','3175994836','','','','info@meadowbrookseniorliving.com','www.meadowbrookseniorliving.com',1,1,NULL,'',NULL,'Welcome to Meadow Brook Senior Living, a new community in Fishers, IN. Here you or your loved one can enjoy a full lifestyle that balances activity, independence and assistance. It includes upscale amenities, chef-prepared meals, concierge services, transportation and enriching activities—all in a quaint town in Hamilton County, Indiana. \r\n\r\nA truly all-inclusive senior living community, Meadow Brook offers five living options. Whether you need light care or more assistance, and a short-term stay or long-term home, you’ll find it here—for care that meets your needs today, and down the road.\r\n\r\nFrom the first moment, you feel the energy of our active senior living community. Led by our Department of Fun, you and your loved one can stay happy and engaged with daily activities – some onsite and other outside the community.','Amy Anderson','3033608812','aanderson@spectrumretirement.com','KcOaGhR2SslBIPg3DVd7xDJ2V10kcMmy56ylGOPyobQOenBfoGtF8OAU6QKqK8hc0J2lyQ','2017-02-18 09:04:33','2017-06-07 14:40:26'),(76,'The Enclave Senior Living at Saxony','community_images/1487427390_6d9pvyn2db.jpg','community_images/1496860780_bsb6gwh5pe.jpeg','12950 Tablick Street',NULL,'Fishers','Indiana','46037','39.9852139','-85.9283477','3172383786','','','','info@theenclaveseniorlivingatsaxony.com','www.thenclaveseniorlivingatsaxony.com',1,1,NULL,'',NULL,'Welcome to The Enclave Senior Living at Saxony, a luxury senior living community in Fishers, IN. Here you can enjoy a full lifestyle that balances activity, independence, and personal assistance. Our community offers 160 comfortable, maintenance-free apartments, along with luxurious amenities, chef-prepared meals, concierge services, transportation, and enriching activities.','Amy Anderson','3033608812','aanderson@spectrumretirement.com','kOAfJrezSopgmQf6FNdV2C3yECSL0QWKKzFZa0ZGJdXxAjI4PXcGsaTNAS3otk5Op0pjrg','2017-02-18 09:16:31','2017-06-07 14:39:40'),(78,'Westminster Village North','community_images/1487431241_vo8rzkd3a5.jpg','community_images/1490708052_o28bu0362l.jpeg','11050 Presbyterian Drive',NULL,'Indianapolis','Indiana','46236','39.872544','-85.9700189','3178236841','','','',NULL,'www.westminstervillage.com/',1,1,NULL,'',NULL,'Westminster Village North is a nonprofit, nondenominational continuing care retirement community offering seniors residency and life options that best align with their vision of retirement. Our campus is set on 57 beautiful and historic acres located on the northeast side of Indianapolis, just south of Geist Reservoir.\r\nWe recognize that seniors are looking for a retirement community that includes safety and maintenance free homes combined with social opportunity to meet new friends and share interests.\r\nResidency options include:\r\nIndependent living apartments and homes\r\nAssisted living apartments\r\nMemory care\r\nShort-term rehabilitation\r\nLong-term nursing care','Laura Roman','3178266064','lroman@WestminsterVillage.com','EEkTwl9VDbymuavAgbYB6W0jnoSdmdWLPBlHXfi2NUDgu3JV0QJzCvJC3PZy9zWhAo9jst','2017-02-18 10:20:42','2017-03-28 09:34:12'),(79,'Traditions at Solana','community_images/1487432865_i9g2mipedw.jpg','community_images/1490294708_q76hu6gps7.jpeg','7721 Battery Pointe Way',NULL,'Indianapolis','Indiana','46240','39.8968968','-86.1178538','3174553575','','','',NULL,'www.traditionsatsolana.com/',1,0,NULL,'',NULL,'Traditions at Solana, located in beautiful Indianapolis, Indiana, provides a gracious waterfront senior retirement community. Walking paths that provide unparalleled water and wildlife views of the White River give the feeling of an idyllic park setting.\r\n\r\nTraditions at Solana is a licensed senior retirement community with no large entry fee or endowment. Residents are served by providing superior, yet reasonably priced accommodations and services in a peaceful, beautiful setting. Living options include licensed assisted living, assisted living memory care and independent living garden home residences. We provide a home-like setting for those who need assistance with personal care and daily living activities. \r\n\r\nThe Wellness Director creates an individualized personal service plan which allows residents to live life on their own terms, while enjoying the company of others in a community setting. Licensed 24-hour nursing staff are available to monitor healthcare needs for those residents needing assistance with personal care and daily living activities.\r\n\r\nTraditions at Solana creates a warm, safe, secure, and friendly environment, promoting independence and self-esteem for all residents.','Dick Hamman','2604138444','DickHamman@traditionsmgmt.net','700NvdAXgr8yWHLsV9hpAStOLZHuMOtttrLLASJOzqfRFcJj1Y6LHaRlIDsHAtavAu6aVl','2017-02-18 10:47:45','2017-03-23 14:45:08'),(80,'Traditions at Reagan Park','c