 home-like setting for those who need assistance with personal care and daily living activities.\r\n\r\nThe personal service plan is created to allow residents to live life on their own terms, while enjoying the company of others in a community setting. Licensed 24-hour nursing staff are available to monitor healthcare needs for those residents needing assistance with personal care and daily living activities.\r\n\r\nTraditions at Brookside creates a warm, safe, secure, and friendly environment, promoting independence and self-esteem for all residents.','Dick Hamman','2604148444','DickHamman@traditionsmgmt.net','cNXCbMgTnhEceqtgvZSx4ZWMtA0fsiHlZUE3Jhfz1HmBdJK81yo8lZx5gxqeKN4BOHX0lG','2017-02-18 11:26:57','2017-03-23 14:45:11'),(82,'Traditions at North Willow','community_images/1487435921_yz17kbjwjk.jpg','community_images/1490294713_c5uvou1blf.jpeg','1703 W. 86th St',NULL,'Indianapolis','Indiana','46260','39.909604','-86.190598','3178639388','','','',NULL,'www.traditionsmgmt.net/senior_living/Indianapolis_IN/zip_TBD/traditions_management/13586',1,0,NULL,'',NULL,'The North Willow Information Center is open now! Fully opening in June of 2017, Traditions at North Willow brings a highly desirable new senior living option to the residents of greater Indianapolis. Our community is ideally located next to St. Vincent’s flagship hospital campus on the north side of Indianapolis and will provide multiple living and care options, including independent living, assisted living and memory care. Our residents, their family members and guests will enjoy the beautifully appointed senior living community, the multiple dining and shopping amenities that are seconds away, as well as the peace of mind and convenience to healthcare services provided by one of Indianapolis’s top hospitals right next door.','Dick Hamman','2604138444','DickHamman@traditionsmgmt.net','3dQ5VRhxHxGzRkoCkYoxyiqCoU82LeJ60Fp3Pu24EQ26iXyDz8yQj2NAQUDOsSZmctt0L5','2017-02-18 11:38:42','2017-03-23 14:45:14'),(83,'The