240','39.9226277','-86.136934','3178449994','','','',NULL,'crestwood-living.com/north.html',1,0,NULL,'',NULL,'','Sarah Berger','3178449994','sberger@justus.net','Iegx4HB1rCkclNKZAy3FLVZsTyRZCpwVXcQCMVtuNmfZH5ANGiCRTS4gqgjj0tdq7JuV9L','2017-02-28 10:50:54','2017-03-23 14:45:22'),(88,'Crestwood Village South','community_images/1488297317_6cw169hj96.jpg','community_images/1490294723_4ulisihwnu.jpeg','8809 Madison Avenue',NULL,'Indianapolis','Indiana','46227','39.6382124','-86.1179769','3178887973','','','',NULL,'crestwood-living.com/south.html',1,0,NULL,'',NULL,'','Sarah Berger','3178887973','sberger@justus.net','rMAWYo9XJ8LN9LmLIP5JcjTDxLwzHizim0furvc5JlomgB4Qz16zV0XFS03VklNTdYrdk9','2017-02-28 10:55:18','2017-03-23 14:45:23'),(89,'Crestwood Village','community_images/1488297558_dbx81b6bzl.jpg','community_images/1490294724_ozdxrb0jv7.jpeg','1123 N. Edmondson Ave.',NULL,'Indianapolis','Indiana','46219','39.7844145','-86.0498648','3173564173','','','',NULL,'crestwood-living.com/east.html',1,0,NULL,'',NULL,'','Sarah Berger','3173564173','sberger@justus.net','SYZwo7nGDD8AZfZd2ox8whTD0jAmZjVIJjHBJYHFpslUNILSAHTYu0POvbIlz8mzmJzKxm','2017-02-28 10:59:19','2017-03-23 14:45:24'),(90,'Crestwood Village West','community_images/1488297697_kwn9d1cica.jpg','community_images/1490294725_hnjciahfd8.jpeg','230 Welcome Way Blvd.',NULL,'Indianapolis','Indiana','46214','39.7700467','-86.2924874','3172716475','','','',NULL,'crestwood-living.com/west.html',1,0,NULL,'',NULL,'','Sarah Berger','3172716475','sberger@justus.net','KF7DQkK3ZJzkqWxFLdTUhQflm0tg564CVbRH32JmNv8FAydlP6qgZqe3fEeM0WMnuZpTnS','2017-02-28 11:01:38','2017-03-23 14:45:26'),(91,'Woodland Terrace of Carmel','community_images/1488298097_5ssld74l1n.jpg','community_images/1490294727_5evei2nq9t.jpeg','689 Pro Med Lane',NULL,'Carmel','Indiana','46032','39.984107','-86.1381322','3176160858','','','','info@woodlandterraceofcarmel.com','woodlandterraceofcarmel.com/',1,0,NULL,'',NULL,'Bold, fresh and innovative — Woodland Terrace of Carmel offers luxury living at an impressive value. From floor to ceiling, this premier senior community is built to provide the finest senior lifestyle options in independent living, assisted living, memory care, personalized care and hospitality services. Designed by a team of award winning architects, interior designers and senior housing specialists, Woodland Terrace will inspire you to engage in the next chapter of life.\r\n\r\nWoodland Terrace is conveniently nestled in a private, wooded setting amidst the vibrant city of Carmel, Indiana. Ranked the Best Place to Live in America by CNN Money Magazine, Carmel is one of Hamilton County’s most coveted locations for entertainment, dining, shopping and recreation. It’s the perfect place to call home.\r\n\r\nThe Perfect Location\r\nWoodland Terrace is conveniently nestled in a private, wooded setting amidst the vibrant city of Carmel, Indiana. Ranked the Best Place to Live in America by CNN Money Magazine, Carmel is one of Hamilton County’s most coveted locations for entertainment, dining, shopping and recreation. It’s the perfect place to call home.\r\nPremium Lifestyle Options\r\nWoodland Terrace offers a full spectrum of care and services so you can live in the community you love — even when your needs change! Your maintenance-free apartment home promotes your individual style and personality so that everyone (even pets!) feel welcome. State-of-the art concierge technology is featured throughout the community and integrated into every apartment home. \r\n\r\nDiscover a community of close friends and enjoy a variety of services and activities that will keep you active, engaged and full of life. Inspired by a dedication to the mind, body and spirit, Woodland Terrace features art, music and technology studios with a visual arts gallery and an outdoor performing arts auditorium. Cutting-edge fitness centers with certified personal fitness trainers will enhance your vitality. Serenity, balance, and strength may be found within the yoga studio or in the community chapel. Refine your palette with your choice of casual or fine dining including a pub, a bistro and a rooftop terrace. There’s so much to see and do at Woodland Terrace!','Sarah Berger','3176160858','sberger@justus.net','gd3MdCNAGmhcYJDdjS2IgGypP8DmB2xZBjstCxLy0ZzJ65W0JJ2VJ6Wdz2ahXv4YZvWVNT','2017-02-28 11:08:18','2017-03-23 14:45:27'),(92,'Woodland Terrace of New Palastine','community_images/1488298451_8gk55kzpku.jpg','community_images/1490294728_awgcjl9o42.jpeg','4400 Terrace Dr',NULL,'New Palestine','Indiana','46163','39.723643','-85.9096849','3176204551','','','','info@woodlandterraceofnewpal.com','woodlandterraceofnewpal.com/',1,0,NULL,'',NULL,'','Sarah Berger','3176204551','sberger@justus.net','ik5wFdKIOjhp3shg4QGmR4hyEUk0mPUZlTXEZNBhxuVshanOMOha85G3QMjkaJxjDKmjJk','2017-02-28 11:14:12','2017-03-23 14:45:29'),(93,'Robin Run Village','community_images/1488301173_g2zwt7pq2m.jpg','community_images/1499439104_b3dq0b76d8.jpeg','5354 West 62nd St.',NULL,'Indianapolis','Indiana','46268','39.8707762','-86.2527589','3172935500','','','',NULL,'www.brookdale.com/en/communities/robin-run-village.html',1,1,NULL,'',NULL,'We provide a full continuum of care, including independent living, assisted living, Alzheimer\'s and dementia care, and skilled nursing and rehabilitation. \r\n\r\nOur beautifully-landscaped campus offers the convenience of well-appointed amenities on property, including a beauty salon and barber shop and on-site banking and postal services. With its valued location near shops and restaurants, our community is just minutes from banks, physicians’ offices and attractions in downtown Indianapolis. We offer a variety of fitness classes, an aquatic center with indoor, heated swimming pool, an outdoor gardening area, extensive paths for walking and biking, plus nature trails.\r\n\r\nOur life care program empowers residents to enjoy a dynamic lifestyle with choices to meet their changing needs. Moving through our continuum of care is simple and affordable. The life care program is secured with an entry fee purchase that covers both the cost of your future accommodations as well as discounted healthcare services, if or when needed. \r\n\r\nBest of all, our life care program comes with a life care guarantee*, promising your accommodations are guaranteed for life, even if your assets are exhausted through no fault of your own.\r\n\r\n*The Life Care Guarantee is subject to the terms of the Residency Contract and only apply if your community provides accommodations and health-related services applicable to the level of care you may require. ','Colleen Hauser','9738890006','chauser@marketsmithinc.com','a5QC36KvCP7SHnqZ1n4MALLWwhfOVqnDZ47aWRhdUVet5qt6HesQXPjGacLGvMrJ9xd1yM','2017-02-28 11:59:33','2017-07-07 10:51:44'),(94,'Brookdale Carmel','community_images/1488302151_izpd0pyxs6.jpg','community_images/1490294732_5ddvbzzivs.jpeg','301 Executive Drive',NULL,'Carmel','Indiana','46032','39.9633148','-86.1219664','3124275406','','','',NULL,'www.brookdale.com/en/communities/brookdale-carmel.html',1,0,NULL,'',NULL,'','Colleen Hauser','9738890006','chauser@marketsmithinc.com','2XKUOJrnOEAdSdv8wWiV8ecYYVKVhpadHZsCvblvNtOUnwnZ5A8HmWNTAeOrcLRaWzxiEc','2017-02-28 12:15:52','2017-03-23 14:45:32'),(95,'Brookdale Castleton','community_images/1488302593_93gtupcmjn.jpg','community_images/1490294733_q4t52s15uu.jpeg','8480 Craig Street',NULL,'Indianapolis','Indiana','46250','39.9103951','-86.0545073','3175970526','','','',NULL,'www.brookdale.com/en/communities/brookdale-castleton.html',1,0,NULL,'',NULL,NULL,'Colleen Hauser','9738890006','chauser@marketsmithinc.com','vGeHZfo6Jc70BWFQt5wzWRicv4RwLof1jEJ94XIlvjGQHejeSva427uxiUeWxj8CbafIKd','2017-02-28 12:23:14','2017-03-23 14:45:33'),(96,'Wellbrooke of Carmel','community_images/1488303311_aamr0vbshs.jpg','community_images/1490294734_0o9snfaqf8.jpeg','12315 Pennsylvania Street',NULL,'Carmel','Indiana','46032','39.96696','-86.152738','3175697200','','','',NULL,'trilogyhs.com/browse-locations/item/wellbrooke-of-carmel',1,0,NULL,'',NULL,'One of the fastest-growing communities outside of Indianapolis, the city of Carmel has kept its small town charm while earning a reputation for being at the forefront of innovation. Cozy yet cosmopolitan, it is the perfect place for Wellbrooke of Carmel; a senior health and hospitality campus for those looking to redefine senior living. Whether they choose to explore streets lined with shops, cafes, and friendly faces, or enjoy an afternoon surrounded by comfort and style on our campus, there are a variety of ways for Wellbrooke residents to stay active and engaged, every day.  \r\n\r\nWe know that selecting the right healthcare option to meet your needs is important. That’s why, with Wellbrooke of Carmel, you’ll find a complete continuum of care and services so you can select the level of care that most closely matches your needs and preferences. Care and support services are carefully coordinated from level to level, setting to setting, as care needs increase or decrease.\r\n\r\nFrom assisted living services in our elegant residential facility, to skilled nursing and outpatient therapy services in our state-of-the-art health center, our staff of committed professionals provides compassionate care with attention to every detail. Whether for a few days, a few weeks, or for as long as you need us…It’s comforting to know that there is a source in Carmel you can turn to for help and guidance.  ','Tim Runge','8324371477','tim@patriotadvertising.com','qZZ8V2XY6h3g0x8i06Ec19lAlGH3ian94wsP28YJIJ7V2yGp6wSwOM8gYA8q1qlF29tKR6','2017-02-28 12:35:12','2017-03-23 14:45:35'),(97,'Clearvista Lake Health Campus','community_images/1488379136_Hqo7PuTte2.jpg','community_images/1490294736_t5byx8pq93.jpeg','8405 Clearvista Place',NULL,'Indianapolis','Indiana','46256','39.90897','-86.0410929','3175785700','','','',NULL,'trilogyhs.com/browse-locations/item/clearvista-lake-health-campus',1,0,NULL,'',NULL,'','Tim