ey become an extension of your family.\r\n\r\nAllisonville Meadows is located in the suburbs of Indianapolis, the state capital and largest city near central Indiana. Indianapolis falls within Fall Creek and Delaware Townships of Hamilton County. We are a short distance from shopping, restaurants and just minutes away from Interstate 465 and Interstate 69, allowing for easy access to the off-campus activities and local attractions. The Indianapolis Metropolitan Airport is just a 20 minute drive. Other landmarks include the Fishers Fire Station and Balmoral Golf Course.\r\n\r\nCall and ask for a member of our admissions team for more information about our senior healthcare options, or stop by and visit. We look forward to serving you!','Elaine Benken','3177882500','elainebenken@ascseniorcare.com','XpkWQKbtHgB2UJ0ZJe2ZUQFms7KYLFJjdqMfJsRi56RnHngEn8tdGdlgGmPmX48u0Uep8j','2017-03-02 11:17:32','2017-03-23 14:46:32'),(139,'Brownsburg Meadows','community_images/1488471543_6sqfyvim3s.jpg','community_images/1490294793_5iqngkhod9.jpeg','7133 Meadow Trail',NULL,'Brownsburg','Indiana','46112','39.8845367','-86.3933212','3173180766','','','',NULL,'www.ascseniorcare.com/location/brownsburg-meadows-assisted-living/',1,0,NULL,'',NULL,'','Elaine Benken','3177882500','elainebenken@ascseniorcare.com','9kGbrHLSJuVmnzJJhMDkI6ZKjjS0V7XCkmViurfqHySEO1po5IqvfMgk1fCu95Shsz886J','2017-03-02 11:19:03','2017-03-23 14:46:34'),(140,'Meadow Lakes','community_images/1488471874_y4lylcsr3e.jpg','community_images/1490294795_ngg6f1kmt1.jpeg','200 Meadow Lakes Dr',NULL,'Mooresville','Indiana','46158','39.62307','-86.35562','3172966412','','','',NULL,'www.ascseniorcare.com/location/meadow-lakes/',1,0,NULL,'',NULL,'','Elaine Benken','3177882500','elainebenken@ascseniorcare.com','2dXiMS8wzu4iyxhIgIuanq0f63JrIOmZ2Z7JUJOJHcXJQXRsVcU6BmL3iNXxWWb7BOzlEo','2017-03-02 11:24:35','2017-03-23 14:46:35'),(141,'Danville Regional Rehabilitation','community_images/1488472080_7spdnh1bp5.jpg','community_images/149029479