ites and two-bedroom suites.  Stonecrest of Meridian Hills will have 30 suites within a specially designed Memory Care neighborhood with a wonderful and secured courtyard.\r\n\r\nAt Stonecrest of Meridian Hills, we understand that social interaction, eating habits and overall well-being are enhanced by a dining experience that is filled with delicious food, engaging conversation and an inviting atmosphere.  With this in mind, we incorporated the award-winning Dining By Design program.  From signature dishes served with well-rounded food choices, to seasonal menus and resort-like service, dining at Stonecrest of Meridian Hills is certainly one-of-a-kind.  You won\'t want to miss our chef\'s table for an unforgettable dining and demonstration experience!\r\n\r\nWhy Wait?  Visit Today\r\n\r\nWhen residents choose Stonecrest of Meridian Hills as their home, they enjoy an engaging environment, complete with delicious dining, an amenity-rich lifestyle and a variety of health-promoting personalized care services.','Linda Wise','3172532020','lwise@stonecrestseniorliving.com','cJMDL7uGwFu8ra7XgYJmrOneF5rbseyE6y6HBNzMwpZcZvM0OtDiTo0wxzROJcF7fo2R3S','2017-03-03 08:58:31','2017-06-01 12:10:36'),(148,'Charles Major Manor','community_images/1488549691_yr4u4mgms4.jpg','community_images/1490294808_1q813xkfjb.jpeg','102 E. Franklin Street',NULL,'Shelbyville','Indiana','46176','39.525476','-85.77407','3173983316','','','',NULL,'www.rhf.org/location/charles-major-manor/',1,0,NULL,'',NULL,'','Jason LaPaglia','3174447058','jlapaglia@gannett.com','RQHLS6gMPyWghAMiaw9Omx1d1U3hI387P3XX1uZrhMtePxEYWqKZUtzUXGijbj6OcfZUD1','2017-03-03 09:01:32','2017-03-23 14:46:48'),(149,'The Towers of Crooked Creek','community_images/1488549833_e3hxup9ze6.jpg','community_images/1490294810_y14yofq0tr.jpeg','7988 N Michigan Road',NULL,'Indianapolis','Indiana','46268','39.89934','-86.217731','3178750618','','','',NULL,'www.rhf.org/location/crooked-creek-tower/',1,0,NULL,'',NULL,'','Jason LaPaglia','3174447058'