INSERT INTO `community_category_memberships` VALUES (203,47,2,''),(204,47,4,''),(205,47,6,''),(206,48,2,''),(207,48,4,''),(208,48,7,''),(209,48,8,''),(210,48,10,''),(211,50,2,''),(212,50,3,''),(213,50,4,''),(214,50,7,''),(215,50,8,''),(216,50,9,''),(217,50,10,''),(270,74,2,'The Independent Living community blossoms at Carmel Senior Living. Here you’ll find everything you need to lead a fun and lively life.. You’ll find activities and amenities to keep your days full. Plus, we take care of all the household tasks—so you have freedom to enjoy your retirement. Let us take care of everyday chores like cleaning, landscaping or yard maintenance and home care, so you can spend your days enjoying life in a myriad of ways.'),(271,74,4,'A safe, welcoming place to live that’s perfect for seniors who no longer live in their own homes, the Assisted Living community at Carmel fosters your loved one’s independence and respects their privacy, dignity and individuality.\r\n\r\nCarmel Senior Living offers our residents and their family members a simple two-tiered, inclusive rate for monthly apartment rental and care services. \r\n\r\nThe Gold Tier allows our residents with lighter care needs to have a lower cost inclusive rate. While the Platinum Tier allows residents with higher care needs a predictable inclusive rate as well.  The Platinum level would covers all the care services we can provide to your loved one while living at our community. \r\n\r\nPrior to moving to our assisted living community in Carmel, IN, your family will work with a nurse to create a custom care plan. The personalized assessment will determine the tier that best matches the resident’s care needs and will be the foundation for the customized care plan. This allows families to have peace of mind and no surprises about changing care costs if care needs change. \r\n\r\nFeel comfortable knowing that our caring assisted living team will have nursing and caregiving staff available 24 hours a day, 7 days a week.'),(272,74,8,'Recognized by the Alzheimer’s Association for leadership in dementia care, Carmel Indiana\'s Carmel Senior Living offers the proprietary Path to the Present® Resident-Directed Program. It recognizes your loved one’s abilities and preferences, and supports him or her in doing as much self-care as possible. So whether he or she has Alzheimer’s Disease or another type of memory loss, your loved one can maintain independence.\r\n\r\nResident-Directed Care\r\n\r\nRather than asking your loved one to conform to our environment, we’ve created an assisted living environment that conforms to people with dementia. This helps your loved one reach his or her greatest potential—mentally, physically and spiritually.\r\n\r\nThis unique approach: \r\n\r\nEngages your loved one in meaningful daily activities\r\nHelps him or her regain a sense of purpose\r\nReconnects him or her with the larger world'),(273,75,2,'The Retirement Living community blossoms at Meadow Brook Senior Living. Here you can lead a vibrant, healthy lifestyle in every way. You’ll find activities and amenities to keep your days full. Plus, we take care of all the household tasks—so you have freedom to enjoy your retirement.'),(274,75,4,'Meadow Brook gives you a safe home where your desire for independence and need for assistance are balanced. You get enriching activities plus help with activities of daily living (ADLs), housekeeping and transportation to create a full life.\r\n\r\nMeadow Brook Senior Living offers our residents and their family members a simple two-tiered, inclusive rate for monthly apartment rental and care services. \r\n\r\nThe Gold Tier allows our residents with lighter care needs to have a lower cost inclusive rate. While the Platinum Tier allows residents with higher care needs a predictable inclusive rate as well. The Platinum level would cover all the care services we can provide to your loved one while living at our community.\r\n\r\nPrior to moving to our assisted living community in Fishers, IN, your family will work with a nurse to create a custom care plan. The personalized assessment will determine the tier that best matches the resident’s care needs and will be the foundation for the customized care plan. This allows families to have peace of mind and no surprises about changing care costs if care needs change.'),(275,75,8,'Meadow Brook Senior Living offers the proprietary Path to the Present® Resident Directed Program. It recognizes your loved one’s abilities and preferences, and supports him or her in doing as much self-care as possible. So whether he or she has Alzheimer’s Disease or another type of memory loss, your loved one can maintain independence and dignity. \r\n\r\nRather than asking your loved one to conform to our environment, we’ve created an assisted living environment that conforms to people with dementia. This helps your loved one reach his or her greatest potential—mentally, physically and spiritually.'),(276,76,2,'Active seniors appreciate The Enclave Senior Living at Saxony and our independent living apartments. This resort-like community features a full activities calendar, transportation services, access to life enriching wellness programs, and so much more. We support your independence and encourage you to make your own decisions, so that the life you live is the life you love.'),(277,76,4,'The Enclave Senior Living at Saxony offers a supportive environment for seniors in need of Assisted Living care in Fishers, Indiana. This innovative program offers seniors who can no longer live on their own a welcoming home in a convenient location. We foster your independence and supplement your well-being with a healthy offering of activities, amenities, and services. \r\n\r\nEnjoy the privacy of an assisted living apartment at The Enclave Senior Living at Saxony. Most of our spacious apartments feature an in-home washer and dryer as well as a spacious walk in closet, emergency call system and full bathroom with step-in shower.'),(278,76,8,'At The Enclave Senior Living at Saxony, we’ve made it our mission to help Fishers area seniors living with Alzheimer’s disease and other dementia-related illnesses live a full and purposeful lifestyle. We recognize our residents’ preferences and abilities so that we can craft a care plan that caters to their unique needs. Our Memory Care community is here for your loved one now, and in the future. We offer the proprietary Path to the Present® - A Resident Directed Program. Our innovative approach to Memory Care supports your loved one in doing as much self-care as possible, so they can maintain their independence.'),(284,78,2,'Are you ready to enjoy your retirement without thought to yardwork and home maintenance? Are you looking for social and educational opportunities, and the chance to meet new friends? Do you hope that your next home will support your physical, spiritual and medical needs for the rest of your life?\r\nIf you answered yes, you should visit Westminster Village North. We offer a variety of homes and apartments with differing price points and options. Bring your wish list and we can share our offerings.\r\nIndependent living at Westminster Village North can be as individual as you are. There are several styles of traditional ranch or modern cottages and spacious one, two or three-bedroom apartments designed to provide a luxurious and comfortable home.\r\nWondering which independent living solution is right for you? We would love to talk you through your options.'),(285,78,3,'As a continuing care retirement community, Westminster Village North makes a commitment to every life occupant resident:  We will care for you throughout the remainder of your lifetime, as your medical needs change, even if your assets are depleted.\r\nMany people find this reassuring. And they especially appreciate the beautiful homes and apartments that they can call home. And, if their medical needs change and they need additional support, our residents move easily to our licensed Assisted Living or Health Center communities. Combined with abundant social opportunities, delicious meals and maintenance, housekeeping and security support, many seniors find they are able to enjoy their retirement years with peace of mind.\r\nAs part of our life plan community, Westminster Village North offers:\r\nSpacious Independent Living Apartments\r\nTraditional Ranch Homes\r\nAttached Cottage Homes\r\nLicensed Assisted Living\r\nAssisted Living Memory Care\r\nMedicare-Certified Rehabilitation and Therapy\r\nLicensed Health Center\r\nSkilled Nursing Memory Care\r\nSkilled Nursing and Long Term Care'),(286,78,4,'If you are looking for a new home for yourself or your loved one that offers supportive nursing care, vibrant social activities and opportunity for additional care, should the need arise, you should visit the licensed Assisted Living apartments at Westminster Village North. At Westminster Village North, your Assisted Living apartment rent includes the cost of your nursing care – we don’t subscribe to “level of care” additional fees. So you can be sure you will get the care you need at the price you agreed.\r\nSelect a studio, one or two-bedroom apartment from a variety of floor plans, all available under our rental program starting at $4,013 per month. Life occupancy options are also available.'),(287,78,6,''),(288,78,7,''),(289,78,8,'According to the Alzheimer’s Association, more than 5.4 million people have Alzheimer’s disease or other forms of Dementia. Caring for a loved one with memory loss can become overwhelming. At Westminster Village North, we offer a community atmosphere featuring trained nursing care in a secure, comfortable environment. Your loved one will be compassionately cared for, and you will be supported as well.\r\n \r\nEarly Stages\r\nThe Ironwood Memory Suites are the perfect blend of privacy and socialization for those in early to mid-stage memory loss. With a cozy environment similar to home, and activities and crafts designed for all to participate, many families feel their loved ones are in a better place than they were at home. Ironwood was recently renovated with natural, soothing colors and comfortable furnishings.\r\nPrivate pay or long-term care insurance and commercial insurance patients are accepted at Ironwood.\r\n \r\nAdvanced Stages\r\nCedar Commons is designed for individuals whose disease is more advanced. With both private and semi-private suites with warm colors and furnishings, Cedar Commons is a comfortable home for residents and a peaceful choice for their families. A generous activity space includes a therapy-focused program to keep our residents as active and involved as possible.\r\nCedar Commons provides 24-hour secure care for residents who are self-pay, Medicare, Medicaid or have commercial insurance.'),(290,78,9,'rand new private rehabilitation suites provide our residents who are recovering from surgery or a medical condition a restful atmosphere. The beautiful and spacious rooms with windows and comfortable seating for guests are appreciated by our residents throughout their stay.\r\nOur clinical staff has the experience and compassion to address the challenges of individuals who have had orthopedic or cardiac surgery, a stroke, or other condition that requires rehabilitation. The Westminster Village North professional rehabilitation therapists design therapeutic programs for our residents to achieve optimal results in:\r\nPhysical Therapy\r\nOccupational Therapy\r\nSpeech Therapy\r\nMassage Therapy\r\nAnd the outstanding Mary Newill Therapy Center contains the latest, state-of-the-art equipment to achieve the best in rehabilitative services.\r\nWestminster Village North accepts Medicare, Medicaid, commercial insurance and private pay.'),(291,78,10,''),(292,79,2,'The Independent Living Garden Home Residences at Traditions at Solana offer maintenance-free active retirement in a variety of spacious floor plans. Our Garden Home Residences are all on one level and feature fully equipped kitchens, relaxing sunrooms, and beautifully landscaped yards. All appliances are provided and all Garden Home Residences include an attached garage. Best of all, no utility bills! \r\n\r\nThe Garden Home Residences are conveniently located on our beautiful campus, with easy access to the main building that features a full service restaurant, chapel, movie theater, beauty salon, fitness room as well as a monthly calendar of events. Scheduled transportation is available on a weekly basis.'),(293,79,4,'Traditions at Solana offers a pleasant and relaxing setting for seniors who may need assistance with personal care and daily living activities. Our Wellness Director creates a personal service plan tailored to each resident.  This plan may assist with daily living activities such as medication management, bathing and/or dressing by our 24-hour licensed nursing staff. Assisted living private residences are all within steps of many amenities including fine dining, recreational activities, as well as a theater. For added peace of mind, an emergency response system is provided.'),(294,79,8,'Traditions at Solana serves seniors who experience various forms of memory loss and cognitive decline.  Individuals are assessed by our staff to identify their cognitive and physical abilities as well as learn about each person\'s unique life story to develop a comprehensive plan of care. Both physical and emotional stimulation are then incorporated into the plan to support and maximize quality of life. A state-of-the-art security system is provided which allows residents to live independently while remaining within the comfort of a secured environment.  We also incorporate, along with group activities, the innovative Behavior-Based Ergonomics Therapy (BBET) to improve the quality of life for our residents with Alzheimers and Dementia.'),(295,80,2,'The Independent Living Garden Residences at Traditions at Reagan Park offer maintenance-fre