Dementia.'),(298,81,2,'The Independent Living Garden Residences at Traditions at Brookside offer maintenance-free active retirement in a variety of spacious floor plans. Our Garden Residences are all on one level and feature fully equipped kitchens, relaxing sunrooms, and beautifully landscaped yards. All appliances are provided and most Garden Residences include an attached garage. Best of all, no utility bills!\r\n\r\nThe Garden Residences are conveniently located on our beautiful campus, with easy access to the main building that features a full-service restaurant, chapel, movie theater, beauty salon and fitness room, as well as a monthly calendar of events.\r\n\r\nScheduled transportation is also available on a weekly basis.'),(299,81,4,'Traditions at Brookside features home-like residences in a setting for seniors who may need assistance with personal care and daily living activities. Our Wellness Director creates a personal service plan specifically tailored to each resident. This plan may include assistance with daily activities, such as medication management, bathing and/or dressing assistance and much more, all provided by a 24-hour licensed nursing staff.\r\n\r\nFor added peace of mind, an emergency response system is provided. Daily programs, events and outings, housekeeping, laundry, and meal service are provided all in a maintenance-free, care-free environment.'),(300,81,8,'Traditions at Brookside serves seniors who experience various forms of memory loss and cognitive decline.\r\n\r\nIndividuals are assessed by our staff to identify their cognitive and physical abilities, as well as learn about each person\'s unique life story to develop a comprehensive plan of care. Both physical and emotional stimulation are then incorporated into the plan to support and maximize quality of life.\r\n\r\nA state-of-the-art security system is also provided which allows residents to live independently while remaining within the comfort of a secured environment.  \r\n\r\nTraditions at Brookside incorporates, along with group activities the innovative Behavior-Based Ergonomics Program (BBET) to improve the quality of life for our residents with Alzheimers and Dementia.'),(301,82,2,''),(302,82,4,''),(303,82,8,''),(304,83,2,''),(305,83,4,''),(306,83,8,''),(307,84,7,''),(308,84,9,''),(309,84,10,''),(310,85,2,''),(311,86,2,''),(312,86,4,''),(313,87,2,''),(314,87,4,''),(315,88,2,''),(316,88,4,''),(317,89,2,''),(318,89,4,''),(319,90,2,''),(320,90,4,''),(321,91,2,'Independent Living awards you the freedom to do what you want to do, when you want to do it. It’s your choice! At Woodland Terrace, we’ve included extra amenities to make life more enjoyable than ever. For one monthly fee, you’ll experience all the comforts of home including:\r\n\r\nAll utilities paid including wireless Internet and cable TV*\r\nChef prepared meals\r\nBi-weekly housekeeping\r\nFull calendar life enrichment opportunities including of classes, workshops, demonstrations, outings and more\r\nScheduled transportation\r\n24-hour concierge and maintenance\r\nHealthcrest℠ Wellness program\r\nState-of-the-art fitness center'),(322,91,4,'For those who require help with daily living activities either now or in the near future, Assisted Living provides all the benefits of Independent Living plus personalized support services including:\r\n \r\n24-hour nursing staff\r\nAssessments by licensed nurse\r\n24-hour emergency response system\r\nThree meals daily in a full-service dining room\r\nWeekly laundry and housekeeping\r\nSocial engagement opportunities every day of the week\r\n \r\nYou’ll benefit from needed and desired services while still enjoying the privacy and convenience of your apartment home. Woodland Terrace offers four levels of care to ensure that you receive the individualized assistance you require including:\r\n \r\nMedication administration\r\nProfessional care management\r\nAssistance with grooming, bathing, dressing and toileting\r\nAssistance with wake-up or bedtime routines\r\nRoom checks and reminders\r\nEscorts to dining and tray service to apartment'),(323,91,8,'Woodland Gardens PATHS (Personalized Approach To Holistic Support) is inspired by the qualities of a true woodland garden — where the trees above offer a canopy of protection and the path below provides freedom to explore and discover. Created specifically for Woodland Terrace, this approach offers a gentle structure while providing the flexibility to meet the unique needs of the residents.\r\n \r\nWoodland Gardens care team is specifically trained to care for residents with dementia, Alzheimer’s disease or other memory disorders. Our courteous and professional staff make it a priority to become acquainted with each resident on a deeper level and create personalized care path which includes:\r\n \r\nIntegrating resident’s life story, interests & preferences\r\nEncouraging daily physical exercise\r\nReinforcing life skills activities\r\nCreating special memory moments\r\nProviding support with flexibility\r\n \r\nWe pay attention to the details! Every space has been carefully designed to provide a safe, comfortable and home-like environment.'),(324,92,2,''),(325,92,4,''),(326,92,8,''),(327,93,2,''),(328,93,3,''),(329,93,4,''),(330,93,8,''),(331,93,10,''),(332,94,8,''),(333,95,4,NULL),(334,96,4,'Our Assisted Living Residence offers gracious living and the support of professional staff to ensure our residents remain as active and as independent as possible. We offer four levels of care options—from moderate to more comprehensive assistance. Residents enjoy beautifully designed private apartments, fine dining, individualized services and an array of activities tailored to their interests and abilities. Should their care needs change, individuals who live in The Residence also have access to around-the-clock skilled nursing care and comprehensive rehabilitation services in our Health Center, without ever having to leave their home.'),(335,96,7,'For individuals caring for a loved one at home, trying to identify the symptoms of Alzheimer’s, dementia or other forms of memory challenges can be difficult. Knowing how to provide the proper care can be even harder. We offer respite care and adult day services at select Trilogy health campuses to give daily caregivers a break and provide some tips for coping. These services are designed to provide a safe and secure environment for short-term stays of a few hours or an entire day. Additionally, some campuses offer adult night services, for caregivers who need assistance or a break during the evening hours. Our Adult Day/Night Services offer a structured program of activities, health monitoring and socialization for adults who have physical or cognitive challenges and/or who may require supervision or assistance with personal care or other daily living activities. Adult day services can also benefit family caregivers by enabling them to maintain their work schedule or to receive needed respite, and by providing them with direct services like support groups and educational programs. Respite Care is offered to seniors who would like to stay with us for a consecutive number of days and nights, ranging from one to thirty days. Respite Care, like Adult Day Health Services, allows the caregiver the opportunity to have some time for themselves. Whether you are planning a vacation or trip, or simply need a break from care giving, rest assured your loved one will receive the care they need at a Trilogy health campus.'),(336,96,9,'We offer a full range of specialized therapy and rehabilitation services for individuals who require care in an inpatient setting. Many of our campuses offer outpatient therapy services as well. Rehabilitation services are provided by Paragon Rehabilitation, our in-house therapy company.\r\n\r\nOur highly-trained staff members offer a full range of medical and rehabilitation services, including physical therapy, occupational therapy and speech language pathology. In our communities, therapists deliver rehabilitation services in state-of-the-art therapy gyms, transitional care resident suites and in the assisted living Residence. Our residents can work out with some of the most modern equipment, using innovative therapy approaches with proven results. We also specialize in short-term rehabilitation stays. Our Home Again Rehabilitation program focuses on helping our patients return home faster and stronger, following an illness or injury. With our comprehensive post-acute “rehab-to-home” services, our patients regain the strength, functioning and mobility they need to return home as independently as possible.\r\n\r\n'),(337,96,10,'Many residents come to us for a short stay following an illness, injury or acute hospital stay, while others require ongoing, quality long-term care and support. Through our health centers, we provide 24-hour skilled nursing services and comprehensive rehabilitative services. Services are tailored to the specific needs of each individual and are delivered by specially trained staff. Services offered in the health center include:\r\n\r\nLong-Term Care\r\nShort-Term Rehabilitation\r\nPhysical, Occupational, and Speech Therapy\r\n24-hour Skilled Nursing Care\r\nOutpatient Therapy\r\nTransitional Care'),(344,102,4,''),(345,102,7,''),(346,102,10,''),(347,103,4,''),(348,103,9,''),(349,103,10,''),(350,104,4,''),(351,104,9,''),(352,104,10,''),(353,105,4,''),(354,105,7,''),(355,105,10,''),(356,106,4,''),(357,106,7,''),(358,106,8,''),(359,106,10,''),(360,107,4,''),(361,107,7,''),(362,107,8,''),(363,107,9,''),(364,107,10,''),(365,108,7,''),(366,108,9,''),(367,108,10,''),(368,109,2,''),(369,110,2,''),(370,110,4,''),(372,110,9,'CarDon & Associates is known for short-term rehabilitation for illness, injury, surgery and other challenges. Rehabilitation is an integral service at Altenheim, as at each of our communities—available to our own residents and to people from the greater community. Our outstanding nursing and therapy teams have the knowledge, skills and experience to guide people through successful short-term rehabilitation and the post-rehabilitation recovery processes.\r\n\r\nOur goal is to help each person return home at their highest level of functioning as quickly and efficiently as possible.\r\n\r\nOur short-term rehabilitation program specializes in treating people who have experienced cardiovascular, neurological, or orthopedic challenges such as strokes or hip fractures. In addition, our short-term rehabilitation staff provides numerous therapies, including:\r\n\r\nVitalStim for swallowing impairments\r\nRespiratory therapy\r\nIntravenous therapy\r\nAnodyne therapy for treating neuropathy, wounds, chronic pain, and arthritis\r\nAccelerated Care Plus (ACP) to speed recovery and reduce pain and swelling following joint replacement surgery\r\nPost-acute rehabilitative care for stroke, heart attack, amputation, balance dysfunction, Parkinson’s disease, multiple sclerosis and other neuromuscular diseases'),(373,110,10,''),(375,111,8,''),(376,111,10,''),(378,112,9,''),(379,112,10,''),(381,113,7,''),(382,113,9,''),(383,113,10,''),(384,114,4,''),(385,114,8,''),(386,114,9,''),(387,114,10,''),(388,115,4,''),(389,115,8,''),(390,115,9,''),(391,115,10,''),(393,116,4,''),(395,116,8,''),(396,116,9,''),(397,116,10,''),(398,117,4,''),(399,117,8,''),(400,117,9,''),(401,117,10,''),(402,118,4,''),(403,118,7,''),(404,118,9,''),(405,118,10,''),(406,119,4,''),(407,119,7,''),(408,119,9,''),(409,119,10,''),(411,120,7,''),(412,120,9,''),(413,120,10,''),(414,121,7,''),(415,121,8,''),(416,121,10,''),(417,122,2,''),(418,122,4,''),(419,122,7,''),(420,122,8,''),(421,122,9,''),(422,122,10,''),(423,123,4,''),(424,123,7,''),(425,123,8,''),(426,123,9,''),(427,123,10,''),(428,124,7,''),(429,124,8,''),(430,125,4,''),(431,125,7,''),(432,125,8,''),(433,125,9,''),(434,125,10,''),(435,126,7,''),(436,126,9,''),(437,126,10,''),(438,127,2,''),(439,127,4,''),(440,127,7,''),(441,127,8,''),(442,127,9,''),(