equire extended care, we can accommodate that too. We carefully examine the needs of our respite guests and provide the level of care required to make their stay comfortable and enjoyable. Family members leave with the confidence that their loved one is safe and in good hands.'),(490,138,8,'While a cure for Alzheimer’s disease does not yet exist, many options are available that enable those with the disease or other forms of memory loss to enjoy a quality of life. The progression of Alzheimer’s and the symptoms that accompany it often make it difficult for family members to continue care at home. We are experts at caring for individuals challenged with memory care issues. Through intense focus in this area, we’ve developed a structured environment that serves residents through individualized attention provided by compassionate caregivers in home-like living conditions.\r\n\r\nOur Auguste’s Cottage is a structured, research-based program utilizing the social model philosophy of care. We care for our residents by making them feel at home, rather than in an institutional setting. Excellent healthcare is always provided, but quality of life is our primary focus. Stimulating daily activities are offered and encouraged to sustain independence and promote a healthy spirit. Auguste’s Cottage is a self-contained center within our community. The concept of the cottage is to focus on maintaining a secure, home- like environment where residents have a sense of belonging. We surround residents with artwork and special personal items from their past to help foster a sense of belonging and cultivate feelings of security. Plants adorn the halls and pets visit frequently. This protected environment fosters dignity and supports autonomy by reducing challenges. The specially designed, uncomplicated floor plan allows residents to stay oriented and move around more easily by offering strong visual cues. Some locations offer multiple centers designed to fit the needs of our residents through each stage of their journey. Program levels vary at each community.\r\n\r\nCompassionate, friendly, patient and knowledgeable are just a few ways to describe the Auguste’s Cottage caregivers. We pride ourselves in being selective and hire only the best professionals and provide them with on-site training and education in memory impairment. Under the guiding hands of our trained Memory Care Facilitators, we pledge to give each resident the highest quality of care possible.\r\n\r\nThe dignity and individual expression of each resident is ensured through providing excellent healthcare, a secure and comforting environment, a clear understanding of memory issues, and a strong compassion for those we serve.'),(491,138,9,'Our Moving Forward program is designed for those striving to restore abilities lost due to stroke, cardiovascular difficulties, orthopedic surgery and other debilitating conditions. Programs vary in frequency and intensity and include physical, occupational and speech/language therapies. Our goal is to return our participants home safely with the skills they need to continue life on their own terms.\r\n\r\nPhysical Therapy focuses primarily on independent mobility, regaining strength and balance, using proper body mechanics and energy saving techniques to better perform mobility tasks.\r\n\r\nOccupational Therapy promotes independence with daily living activities like bathing, eating, dressing, self-care and home management tasks. Participants gain strength and coordination while learning to conserve their energy.\r\n\r\nThe goal of Speech/Language Therapy is to increase functional communication, cognitive skills, and teach safe swallowing by introducing diet modifications and special feeding techniques. Therapy may include muscle retraining, compensatory strategies, and use of communication devices.\r\n\r\nExclusively at American Senior Communities, the Road to Recovery program offers the opportunity for our interdisciplinary team, the patient, and their family to meet within the first 72 hours after admission to map out their Road to Recovery by identifying discharge goals. We monitor our rehabilitation outcomes and use the data to consistently improve our services. In-home assessments are performed by the therapy team prior to discharge to ensure a safe transition back to home.\r\n\r\nUpscale benefits in our Moving Forward Wing (at selected locations) include private suites, exclusive dining area and courtyard, electric beds, spacious living rooms, elegant family lounge area, cable TV and phones.\r\n\r\nServices include wound care, rehabilitation screenings, fall prevention, restraint reduction, restorative nursing, contracture management, wheelchair position and mobility, and walking ability programs. Add this to our highly successful New Energy Wellness (at selected locations) strength building and aerobic conditioning program, and you have an incredible combination that will truly help you move forward!'),(492,138,10,'The physical and emotional struggles that can accompany a debilitating injury or illness can deprive many seniors of the quality of life they’ve earned. Our Skilled Nursing Care is designed to provide compassionate senior medical care to those recovering from stroke, heart attack, orthopedic conditions or other disabilities. We’ve built a team of geriatric nursing specialists who have developed unique protocols and procedures for caring for the elderly through short-term or extended care, encompassing the physical and emotional well-being of each resident.\r\n\r\nLong Term Care is a great option for those who can no longer be cared for at home due to illness, injury, frailty, or other limitations. Under the guidance of an attending physician, long term senior care is provided at our long term care facilities by licensed nurses, specially trained health care aide and a full interdisciplinary care team. Physical, Occupational and Speech Therapies are also available to ensure our long term health care residents function at the highest level of independence as possible. The setting is home-like, cheerful, soothing and secure.\r\n\r\nMedicaid Accepted! Our Medicaid Specialists can assist you through the application process.\r\n\r\nHospice and palliative care for seniors is designed to provide comfort, care and pain relief for those facing terminal illness. We partner with Hospice companies to offer comprehensive hospice services including skilled nursing care, respite care, spiritual and bereavement counseling, medical equipment and supplies, social services, and pharmacy services. By putting together an interdisciplinary team of physicians, nurses, aides, volunteers, social workers and clergy, we can serve the needs of our Hospice patients and their families.'),(493,139,2,''),(494,139,4,''),(495,139,7,''),(496,139,8,''),(497,139,9,''),(498,139,10,''),(499,140,2,''),(500,140,4,''),(501,140,7,''),(502,140,8,''),(503,140,9,''),(504,140,10,''),(505,141,7,''),(506,141,8,''),(507,141,9,''),(508,141,10,''),(509,142,7,''),(510,142,8,''),(511,142,9,''),(512,142,10,''),(513,143,7,''),(514,143,8,''),(515,143,9,''),(516,143,10,''),(517,144,7,''),(518,144,8,''),(519,144,9,''),(520,144,10,''),(521,145,2,''),(522,146,2,''),(524,147,4,'Individual care plans ensure each resident gets just the right amount of care and support when they need it.  Dedicated, professional care staff can assist with medication assistance, bathing and dressing, grooming and other personal care needs, wellness checks and monitoring, ambulation assistance and other activities of daily living care needs.  The entire community staff strives to afford residents an unsurpassed quality of life at Stonecrest of Meridian Hills.'),(526,147,8,'Stonecrest of Meridian Hills offers Generations, our signature person-centered memory care program, which presents opportunities for residents with Alzheimer\'s Disease and other forms of dementia to thrive.  Support at Stonecrest of Meridian Hills is delivered in a 